import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, Nav, NavDropdown, Button, Form } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import '../../css/user/Usuarios.css';

function UserInsert() {
    const [newUser, setNewUser] = useState({
        area: '',
        usuario: '',
        contrasena: ''
    });

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setNewUser({
            ...newUser,
            [name]: value
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await fetch('http://localhost:8000/crear_usuario', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify(newUser)
            });

            if (!response.ok) {
                throw new Error('Error en la solicitud');
            }

            const data = await response.json();
            console.log('Respuesta de la API:', data);
            // Limpiar el formulario después de enviar los datos
            setNewUser({
                area: '',
                usuario: '',
                contrasena: ''
            });
        } catch (error) {
            console.error('Error al enviar los datos:', error);
        }
    };

    return (
        <div className="app">
            <Navbar bg="white" expand="lg" fixed="top">
                <Nav className="ml-auto">
                    <NavDropdown title={
                        <svg xmlns="http://www.w3.org/2000/svg" width="54" height="54" fill="currentColor" className="bi bi-person-circle" viewBox="0 0 16 16">
                            <path d="M11 6a3 3 0 1 1-6 0 3 3 0 0 1 6 0" />
                            <path fillRule="evenodd" d="M0 8a8 8 0 1 1 16 0A8 8 0 0 1 0 8m8-7a7 7 0 0 0-5.468 11.37C3.242 11.226 4.805 10 8 10s4.757 1.225 5.468 2.37A7 7 0 0 0 8 1" />
                        </svg>
                    } id="user-menu" alignRight className="ml-auto">
                        <NavDropdown.Item as={Link} to="/menu">Menu</NavDropdown.Item>
                        <NavDropdown.Divider />
                        <NavDropdown.Item as={Link} to="/">Cerrar sesión</NavDropdown.Item>
                    </NavDropdown>
                </Nav>
            </Navbar>

            <div className="container mt-5 pt-5">
                <h1>Insertar nuevo usuario</h1>
                <Form onSubmit={handleSubmit} id="insertForm">
                    <div id="form-container" className="d-flex justify-content-center flex-column px-5 py-4">
                        <div id="form-container-input" className="d-flex flex-column align-items-center">
                            <div className="form-group d-flex py-2 w-100 justify-content-center">
                                <Form.Control 
                                    type="text" 
                                    id="area" 
                                    name="area" 
                                    className="fs-2 border-bottom-only no-rounded" 
                                    placeholder="Area" 
                                    value={newUser.area} 
                                    onChange={handleInputChange} 
                                    required 
                                />
                            </div>
                            <div className="form-group d-flex py-2 w-100 justify-content-center">
                                <Form.Control 
                                    type="email" 
                                    id="usuario" 
                                    name="usuario" 
                                    className="fs-2 border-bottom-only no-rounded" 
                                    placeholder="Usuario" 
                                    value={newUser.usuario} 
                                    onChange={handleInputChange} 
                                    required 
                                />
                            </div>
                            <div className="form-group d-flex py-2 w-100 justify-content-center">
                                <Form.Control 
                                    type="password" 
                                    id="contrasena" 
                                    name="contrasena" 
                                    className="fs-2 border-bottom-only no-rounded" 
                                    placeholder="Contraseña" 
                                    value={newUser.contrasena} 
                                    onChange={handleInputChange}
                                    required
                                />
                            </div>
                        </div>
                        <div id="form-container-button" className="d-flex align-items-center justify-content-around px-5">
                            <Link to="/usuarios" className="btn btn-outline-dark fs-4 btn-lg rounded-pill">Cancelar</Link>
                            <Button type="submit" className="btn btn-outline-dark fs-4 btn-lg rounded-pill" style={{backgraundColor: white}}>Insertar</Button>
                        </div>
                    </div>
                </Form>
            </div>
        </div>
    );
}

export default UserInsert;
